sys_variable_value.value:
(function execute(inputs, outputs) {
   var res;
  // if(!(inputs.response.premiumSummary) && !inputs.response.code ){
    if(inputs.response &&!(inputs.response.status) && !inputs.response.code ){
    res= JSON.parse(inputs.response);
  }
  else{
     res= (inputs.response);
  }


  if(!inputs.fvressp.responses)
    var resp = JSON.parse(inputs.fvressp);
  else
    var resp =(inputs.fvressp);


  //if(res.status && res.status.toLowerCase()=="success")
  resp.responses.push(res);
  outputs.response = resp;
  inputs.fvressp=resp;

})(inputs, outputs);

